### What is `useEffect`?

`useEffect` is a hook in React that lets you perform side effects in function components. Side effects are operations that can affect other components and cannot be done during rendering, such as data fetching, subscriptions, or manually changing the DOM.

### Basic Syntax

```javascript
useEffect(() => {
  // Code to run after the component renders
  return () => {
    // Optional cleanup code
  };
}, [dependencies]);
```

